import "./SurahButton.css";
const SurahButton = (props) => {
  const surah = props.surah;
  return (
    <div onClick={props.onClick} className="surahButton">
      <text>{surah}</text>
      <h1>hello</h1>
    </div>
  );
};

export default SurahButton;
